import React from 'react';

export interface TableHeadingProps {
  className?: any;
  children?: any;
  maxWidth?: number;
}

const TableHeading: React.SFC<TableHeadingProps> = ({
  maxWidth,
  className,
  children,
}) => {
  return (
    <th scope="col" style={{ maxWidth }}>
      {children}
    </th>
  );
};

export default TableHeading;
